import React, {Component} from 'react';
import './Tab.css';

class Tab extends Component {
  render() {
    return (
      <div className="tab-container">
        <h5 className='tab-title'>{this.props.tab}</h5> 
        <div className='tab-content'></div>
      </div>
    );
  }
}

export default Tab;
